class Solution:
    def findMaxConsecutiveOnes(self, nums) -> int:
        mcnt = 0
        cnt = 0
        for e in nums:
            if mcnt < cnt:
                mcnt = cnt
            if e == 1:
                cnt += 1
            elif e == 0:
                cnt = 0
        mcnt = cnt if cnt > mcnt else mcnt
        return mcnt

s = Solution()
